import React, { useEffect, useState } from "react";
import Header from "./Header";
import Footer from "./Footer";
import "../../styles/flowOne/OffersPage.css";
import { CSSTransition } from "react-transition-group";
import StarRating from "./StarRating"; // Import the StarRating component

const OffersPage = () => {
  const [cityName, setCityName] = useState("your area");

  const offers = [
    {
      id: 1,
      name: "Experian",
      description: "You could save $$ on your car insurance",
      website: "www.experian.com",
      logo: "/path/to/experian-logo.png",
      rating: 5,
    },
    {
      id: 2,
      name: "Jerry",
      description: "Get 40+ Verified Quotes in 5 mins!",
      website: "www.getjerry.com",
      logo: "/path/to/jerry-logo.png",
      rating: 4,
    },
    {
      id: 3,
      name: "The General",
      description: "Saving people money for nearly 60 years!",
      website: "www.thegeneral.com",
      logo: "/path/to/general-logo.png",
      rating: 3,
    },
    {
      id: 4,
      name: "American Family",
      description: "Get Your Fast & Easy Quote Now!",
      website: "www.AmFamQuotes.com",
      logo: "/path/to/american-family-logo.png",
      rating: 4,
    },
    {
      id: 5,
      name: "Savvy",
      description: "Shop smart & fast for car insurance",
      website: "www.savvy.insure",
      logo: "/path/to/savvy-logo.png",
      rating: 5,
    },
  ];

  useEffect(() => {
    const params = new URLSearchParams(location.search);

    const zipCode =
      params.get("zip") || localStorage.getItem("zip_code") || "00000";
    const campaignName =
      params.get("campaign_name") ||
      localStorage.getItem("campaign_name") ||
      "default_campaign";
    const campaignId =
      params.get("campaign_id") ||
      localStorage.getItem("campaign_id") ||
      "default_id";
    const clickId =
      params.get("click_id") ||
      localStorage.getItem("click_id") ||
      "default_click";

    // Load the MediaAlpha ad script with campaign data
    const script = document.createElement("script");
    script.type = "text/javascript";
    script.innerHTML = `
      var MediaAlphaExchange = {
         "data": {
            "zip": "${zipCode}"
         },
         "placement_id": "fD4petSMP9HeM2IAYex88RKg0siJ_Q",
         "sub_1": "${campaignName}",
         "sub_2": "${campaignId}",
         "sub_3": "${clickId}",
         "type": "ad_unit",
         "version": 17
      };
      MediaAlphaExchange__load('mediaalpha_placeholder');
    `;
    document.body.appendChild(script);

    // Fetch city name from ZIP code
    if (zipCode !== "00000") {
      fetchCityName(zipCode);
    }
  }, []);

  const fetchCityName = async (zipCode) => {
    try {
      const response = await fetch(`https://api.zippopotam.us/us/${zipCode}`);
      if (response.ok) {
        const data = await response.json();
        const city = data.places[0]["place name"];
        setCityName(city);
      }
    } catch (error) {
      console.error("Failed to fetch city name:", error);
    }
  };

  return (
    <CSSTransition
      in={true}
      appear={true}
      timeout={1500}
      classNames="fade-slide"
    >
      <>
        <Header />
        <div className="offers-page-container">
          <div className="offers-header">
            <h2>We've Matched You with Great Offers in {cityName}!</h2>
            <p className="subtext">
              USA Insurance Reviews works with many reverse-bidding insurance
              companies. Based on your answers, we have matched you with the top
              aggregator in {cityName} that can get you the best possible deal.
            </p>
            Click View My Quote to see the best prices.
            <p></p>
          </div>

          <div className="offers-list">
            {/* Render offers dynamically */}
            {offers.map((offer) => (
              <div key={offer.id} className="offer-item">
                <div className="offer-content">
                  <img src={offer.logo} alt={`${offer.name} Logo`} />
                  <h3>{offer.name}</h3>
                  <p>{offer.description}</p>
                  <p>{offer.website}</p>
                  {/* Star Rating Below the Offer Content */}
                  <StarRating rating={offer.rating} />
                  <button className="quote-button">View My Quote</button>
                </div>
              </div>
            ))}
          </div>

          <p className="powered-by-text">
            Powered by <span className="brand">usainsurancereviews.com</span>
          </p>
        </div>
        <Footer />
      </>
    </CSSTransition>
  );
};

export default OffersPage;
